.length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2873302","type":"CustomJS"},{"attributes":{},"id":"2873190","type":"DataRange1d"},{"attributes":{"coordinates":null,"group":null},"id":"2873333","type":"Title"},{"attributes":{"axis":{"id":"2873196"},"coordinates":null,"group":null,"ticker":null},"id":"2873199","type":"Grid"},{"attributes":{"source":{"id":"2873040"}},"id":"2873045","type":"CDSView"},{"attributes":{},"id":"2873275","type":"Selection"},{"attributes":{},"id":"2873339","type":"AllLabels"},{"attributes":{"callback":null,"formatters":{"@datetime":"datetime"},"point_policy":"follow_mouse","renderers":[{"id":"2873180"}],"tooltips":[["Date","@datetime{%c}"],["Size","@size{0,0}"],["P/L","@returns_short{+0.[000]%}"]]},"id":"2873184","type":"HoverTool"},{"attributes":{},"id":"2873210","type":"SaveTool"},{"attributes":{},"id":"2873192","type":"LinearScale"},{"attributes":{"label":{"value":"Final (3%)"},"renderers":[{"id":"2873066"}]},"id":"2873084","type":"LegendItem"},{"attributes":{"label":{"value":"Max Dd Dur. (1407 days)"},"renderers":[{"id":"2873114"}]},"id":"2873136","type":"LegendItem"},{"attributes":{"logo":null,"toolbars":[{"id":"2873015"},{"id":"2873161"},{"id":"2872975"},{"id":"2873212"}],"tools":[{"id":"2873007"},{"id":"2873008"},{"id":"2873009"},{"id":"2873010"},{"id":"2873011"},{"id":"2873012"},{"id":"2873013"},{"id":"2873036"},{"id":"2873303"},{"id":"2873153"},{"id":"2873154"},{"id":"2873155"},{"id":"2873156"},{"id":"2873157"},{"id":"2873158"},{"id":"2873159"},{"id":"2873182"},{"id":"2873184"},{"id":"2873303"},{"id":"2872967"},{"id":"2872968"},{"id":"2872969"},{"id":"2872970"},{"id":"2872971"},{"id":"2872
